using Cosmos.System.Graphics;
using System;
using System.IO;

namespace PrismProject
{
    class Driver
    {
        public static int screenY = 600;
        public static int screenX = 800;
        public static SVGAIICanvas canvas = new SVGAIICanvas();
        public static string font = "SegoeUI";


        public static void Init()
        {
            canvas.Mode = new Mode(screenX, screenY, ColorDepth.ColorDepth32);
            #region Font data
            string CustomCharset = "abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ1234567890!@#$%^&*()-_=+[{]}\\|/?,<.>;:'\"`~*🡬";
            string p1 = "";
            string p2 = "";
            string p3 = "";
            string p4 = "";
            string p5 = "";
            string p6 = "";
            string p7 = "";
            string p8 = "";
            #endregion
            MemoryStream SegoeUISemiboldCustomCharset88 = new MemoryStream(Convert.FromBase64String(p1+p2+p3+p4+p5+p6+p7+p8));
            BitFont.RegisterBitFont("SegoeUI", new BitFontDescriptor(CustomCharset, SegoeUISemiboldCustomCharset88, 88));
        }
    }
}
